import React, { useState } from 'react';
import './PrivateDiningCity.css';

const PrivateDiningCity = () => {
  const [activeRoomIndex, setActiveRoomIndex] = useState(0);

  const diningRooms = [
    {
      name: "THE GALLERY",
      location: "The City, London",
      capacity: "Up to 16 guests",
      image: "gallery"
    },
    {
      name: "THE ARCH",
      location: "The City, London",
      capacity: "Up to 22 guests",
      image: "arch"
    },
    {
      name: "THE MEZZANINE",
      location: "The City, London",
      capacity: "Up to 30 guests",
      image: "mezzanine"
    },
    {
      name: "THE LOUNGE",
      location: "The City, London",
      capacity: "Up to 14 guests",
      image: "lounge"
    }
  ];

  const nextSlide = () => {
    setActiveRoomIndex((activeRoomIndex + 2) % diningRooms.length);
  };

  const prevSlide = () => {
    setActiveRoomIndex((activeRoomIndex - 2 + diningRooms.length) % diningRooms.length);
  };

  const titleStyle = {
    color: '#ffffff',
    textShadow: '0 2px 4px rgba(0, 0, 0, 0.3)'
  };

  const buttonStyle = {
    padding: '12px 40px',
    backgroundColor: '#fff',
    color: '#1a1a1a',
    border: '2px solid #fff',
    whiteSpace: 'nowrap',
    fontWeight: 500
  };

  // Get the current pair of rooms to display side by side
  const currentRoomIndex = activeRoomIndex;
  const nextRoomIndex = (activeRoomIndex + 1) % diningRooms.length;

  return (
    <section id="private-dining-city" className="private-dining-city-section">
      <div className="private-dining-city-container">
        <div className="section-header">
          <h2 className="section-title" style={titleStyle}>PRIVATE DINING IN THE CITY OF LONDON</h2>
          <h3 className="section-subtitle">Unforgettable Experiences at Kaboul Gourmet</h3>
          <p className="section-description">
            Unforgettable experiences for any event from intimate private dining to exclusive hire
            venues upto 150 guests.
          </p>
          <a href="#rooms" className="discover-button" style={buttonStyle}>DISCOVER ROOMS</a>
        </div>

        <div className="rooms-slider-container">
          <button className="slider-arrow prev" onClick={prevSlide} aria-label="Previous rooms">
            <span className="arrow-icon">&#8249;</span>
          </button>

          <div className="rooms-slider dual-display">
            <div className="room-pair">
              {/* First Room */}
              <div className={`room-slide ${diningRooms[currentRoomIndex].image}`}>
                <div className="room-content">
                  <div className="room-title-area">
                    <h3 className="room-name">{diningRooms[currentRoomIndex].name}</h3>
                    <p className="room-location">{diningRooms[currentRoomIndex].location}</p>
                  </div>
                  <div className="room-buttons">
                    <a href="#enquire" className="room-action-button">GET IN TOUCH</a>
                    <a href="#explore" className="room-action-button">EXPLORE</a>
                  </div>
                </div>
              </div>

              {/* Second Room */}
              <div className={`room-slide ${diningRooms[nextRoomIndex].image}`}>
                <div className="room-content">
                  <div className="room-title-area">
                    <h3 className="room-name">{diningRooms[nextRoomIndex].name}</h3>
                    <p className="room-location">{diningRooms[nextRoomIndex].location}</p>
                  </div>
                  <div className="room-buttons">
                    <a href="#enquire" className="room-action-button">GET IN TOUCH</a>
                    <a href="#explore" className="room-action-button">EXPLORE</a>
                  </div>
                </div>
              </div>
            </div>
          </div>

          <button className="slider-arrow next" onClick={nextSlide} aria-label="Next rooms">
            <span className="arrow-icon">&#8250;</span>
          </button>
        </div>

        <div className="decorative-curve"></div>
      </div>
    </section>
  );
};

export default PrivateDiningCity;
